import unittest
import calculate
from unittest.mock import patch 
from unittest import TestCase

class TestCalculate(TestCase):

    @patch('calculate.isleap')
    def test_judge_leap_year(self, mock_isleap):
        
        # Test when the year is a leap year
        mock_isleap.return_value = True 
        result = calculate.judge_leap_year(2020)
        self.assertEqual(result, True)
        
        # Test when the year is not a leap year
        mock_isleap.return_value = False 
        result = calculate.judge_leap_year(2019)
        self.assertEqual(result, False)
        
if __name__ == '__main__':
    unittest.main(verbosity=2)
